import React from 'react';
import './App.css';

function App() {

    const MyCounter = (event:MouseEvent<HTMLButtonElement>) => {
        console.log('It is counter')
    }
    const MyFirstSubskraiber  = (event:MouseEvent<HTMLButtonElement>) => {
        console.log('It is Vasia')
    }

    const MySecondSubskraiber = (event:MouseEvent<HTMLButtonElement>) => {
        console.log('It is Vova')
    }

    return (
        <div className="App">
            <button onClick={MyCounter}>MyFirstYouTobeChenel-1</button>
            <button onClick={MyFirstSubskraiber}>MyFirstYouTobeChenel-2</button>
            <button onClick={MySecondSubskraiber}>MyFirstYouTobeChenel-3</button>
        </div>
    );
}


export default App;
